工作职责:
1.参与核心业务系统的需求迭代和代码优化，独立完成复杂业务功能需求分析及实现；
2.在代码的可测试性、可读性、可维护性、可扩展性安全性上至少有两项表现不错；
3.了解应用发布和运维，能够完成线上故障分析和排查。

任职资格:
1.熟悉通用软件开发基础知识和技能，掌握基本的数据结构和网络知识;
2.熟练掌握Java语言，熟悉常用的设计模式;熟悉Spring框架基本实现原理;
3.熟悉MYSQL的基本语法，和常用DML、DDL的使用，熟悉执行计划;
4.熟悉大流量、高并发、高性能的分布式系统的设计及应用，微服务架构设计，性能调优;具备rediS、ES、MQ等常见中间件对接开发经验者优先。
